import Tag, { TAG_TYPES } from '../Tag/Tag';
import './Card.scss';

const Card = ({ }) => (
    <div className='card'>
        <div className='tags'>
            {/* {
                props.tags.map(tag => <Tag 
                    key={tag.key} 
                    name={tag.name} 
                    color={tag.color}/>)
            } */}
        </div>
        <div className='card-title'>{props.title}</div>
        <div className='card-text'>{props.text}</div>
    </div>
)

export default Card;
